import { Router } from "@material-ui/icons";
/* eslint-disable react/jsx-no-undef */
import React from "react";
import "./App.css";
import Header from "./Header";
import Home from "./Home";

function App() {
  return (
    //BEM Convention
    <Router>
      <div className="app">
        <Switch>
          <Route path="/">
            <Header />
            <Home />
          </Route>
          <Header />
          <Home />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
